INSERT INTO `Articles` (`id`, `title`, `content`, `category_id`, `author_id`, `picture_path`) VALUES
(1, 'Awesome Article', 'Yeah quite a long text.....', 1, 1, 'images/articles/sample.jpg'),
(2, 'About us', 'Herzlich Willkommen! Danke, dass Sie sich auf unserem Portal umschauen. </br>\r\n\r\nDieses Portal wurde im Rahmen des Semesterprojektes "Crowd Thinking" an\r\nder Hochschule Furtwangen unter der Leitung von Prof. Dr. Achim Karduck\r\nerstellt. Es basiert auf einem Fallbeispiel und Konzept, dass im Rahmen der Vorlesung &quot; IT and Sustainable Development&quot; von Professor Karduck (WS 2013/14) durch  den Studenten Patrik Fehrenbach als &quot;Blaupause&quot; entworfen wurde, und im Rahmen dieses Semesterprojekts fortgef&uuml;hrt wird.</br>\r\n</br>\r\nF&uuml;r dieses Projekt kamen Studenten aus unterschiedlichen Semestern von AIB und CNB\r\nzusammen, die gemeinsam eine Projektidee in die Tat umsetzen m&ouml;chten.</br>\r\n</br>\r\nDas Team besteht aus folgenden Mitgliedern:</br>\r\n</br>\r\n-Raphael Werne</br>\r\n-Kilian Neu</br>\r\n-Christian Plotzky</br>\r\n-Felix Penthin</br>\r\n-Luis Vergara"</br>\r\n</br>\r\n</br>\r\n\r\nBetreuer:</br>\r\n</br>\r\nProf. Dr. Achim P. Karduck\r\n', 0, 0, ''),
(3, 'What is Kickstars?', 'Kickstars ist die zentrale Anlaufstelle f&uuml;r alle, die ihre Ideen viral verbreiten m&ouml;chten! <br />\r\n<br />\r\nVirales Marketing und das Erreichen breiter Massen f&auml;ngt beim Einrichten einer zentralen Anlaufstelle an. Und genau hier kommen wir ins Spiel!<br />\r\n<br />\r\nKickstars erm&ouml;glicht Ihnen, Ihr Projekt ansprechend zu pr&auml;sentieren. Und um die Vernetzung mit einer m&ouml;glichst gro&szlig;en Nutzerbasis sicherzustellen, bieten wir Ihnen Funktionen zum Verlinken auf andere Seiten wie z.B. Kickstarter oder Google+. <br />\r\n<br />\r\nWie Sie sehen k&ouml;nnen, ist Kickstars der Grundstein f&uuml;r ein erfolgreiches Projekt. Der Rest liegt bei Ihnen!<br />\r\n<br />\r\nDoch nicht nur virtuelle Projekte, die virales Marketing brauchen, sind bei uns richtig. Sie wollen in Ihrer Stadt oder Ihrem Dorf ehrenamtliche Projekte starten? Kein Problem! Kickstars ist die Anlaufstelle f&uuml;r alle Kreativk&ouml;pfe, die Ihre Ideen auch umsetzen wollen, egal wen Sie ansprechen wollen!\r\n\r\n ', NULL, NULL, '');
