INSERT INTO `wp_options` (`option_id`, `option_name`, `option_value`, `autoload`) VALUES
(4362, '_transient_easydigitaldownloads_add_ons_feed', '<div class="edd-extension"><h3 class="edd-extension-title">Stripe Payment Gateway</h3><a href="https://easydigitaldownloads.com/extensions/stripe-payment-gateway/?utm_source=plugin-addons-page&#038;utm_medium=plugin&#038;utm_campaign=EDDAddonsPage&#038;utm_content=StripePaymentGateway" title="Stripe Payment Gateway"><img width="320" height="200" src="https://easydigitaldownloads.com/wp-content/uploads/2012/04/Stripe-320x200.jpg" class="attachment-showcase wp-post-image" alt="Stripe" title="Stripe Payment Gateway" /></a><p><p>Accept payments through the Stripe.com payment gateway.</p>\n</p><a href="https://easydigitaldownloads.com/extensions/stripe-payment-gateway/?ref=1" title="Stripe Payment Gateway" class="button-secondary">Get this Add On</a></div><div class="edd-extension"><h3 class="edd-extension-title">PayPal Pro and PayPal Express</h3><a href="https://easydigitaldownloads.com/extensions/paypal-pro-express/?utm_source=plugin-addons-page&#038;utm_medium=plugin&#038;utm_campaign=EDDAddonsPage&#038;utm_content=PayPalProandPayPalExpress" title="PayPal Pro and PayPal Express"><img width="320" height="200" src="https://easydigitaldownloads.com/wp-content/uploads/2012/03/PayPal-Pro-and-Express-320x200.jpg" class="attachment-showcase wp-post-image" alt="PayPal-Pro-and-Express" title="PayPal Pro and PayPal Express" /></a><p><p>Accept payments through PayPal Pro and PayPal Express.</p>\n</p><a href="https://easydigitaldownloads.com/extensions/paypal-pro-express/?ref=1" title="PayPal Pro and PayPal Express" class="button-secondary">Get this Add On</a></div><div class="edd-extension"><h3 class="edd-extension-title">Checkout Fields Manager</h3><a href="https://easydigitaldownloads.com/extensions/checkout-fields-manager/?utm_source=plugin-addons-page&#038;utm_medium=plugin&#038;utm_campaign=EDDAddonsPage&#038;utm_content=CheckoutFieldsManager" title="Checkout Fields Manager"><img width="320" height="200" src="https://e