/2014/05/08/wordpress-3-9-1-update-veroeffentlicht-upgradepaket.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:97:"http://blog.wpde.org/2014/05/08/wordpress-3-9-1-update-veroeffentlicht-upgradepaket.html#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 08 May 2014 19:26:39 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:4:{i:0;a:5:{s:4:"data";s:7:"Release";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:5:"3.9.1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:6:"Update";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:15:"WordPress 3.9.1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://blog.wpde.org/?p=2619";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:423:"WordPress 3.9.1 wurde veröffentlicht. Mit dieser Version werden einige Fehler behoben. Eine Aktualisierung auf die neue Version 3.9.1 wird empfohlen. Die Liste der bearbeiteten Tickets kann im Beitrag zum Release Candidate 3.9.1 im offiziellen Entwickler-Blog nachgelesen werden, sowie im Core Trac und im Changelog. Highlights des Updates behoben: Theme-Vorschau hatte die Widgeteinstellungen des aktiven Themes [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Birgit Olzem";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3140:"<p><strong class="teaser"><a href="http://wordpress.org/news/2014/05/wordpress-3-9-1/">WordPress 3.9.1 wurde veröffentlicht</a>. Mit dieser Version werden einige Fehler behoben. Eine Aktualisierung auf die neue Version 3.9.1 wird empfohlen.</strong></p>\n<p>Die Liste der bearbeiteten Tickets kann im <a href="http://make.wordpress.org/core/2014/05/06/release-candidate-for-3-9-1/" target="_blank">Beitrag zum Release Candidate 3.9.1 im offiziellen Entwickler-Blog</a> nachgelesen werden, sowie im <a href="https://core.trac.wordpress.org/query?milestone=3.9.1">Core Trac</a> und im <a href="https://core.trac.wordpress.org/log/branches/3.9?rev=28353&#038;stop_rev=28154">Changelog</a>. </p>\n<h3>Highlights des Updates</h3>\n<ul>\n<li>behoben: Theme-Vorschau hatte die Widgeteinstellungen des aktiven Themes gelöscht</li>\n<li>behoben: die Pfade in einer Multisite korrgiert. s. a. <a href="http://blog.wpde.org/2014/04/22/umleitungen-nach-update-auf-3-9-multisite.html" title="Gelöst: zu viele Umleitungen nach Update auf 3.9 bei WordPress Mulitsite mit Subdomain-Konfiguration" target="_blank">Blogbeitrag</a></li>\n<li>behoben: bizarres Verhalten bei den Headerbildern</li>\n<li>behoben: langsames Laden der Editormaske für Beiträge und Seiten</li>\n<li>behoben: einige Fehler im Drag&amp;Drop Verhalten bei Playlist, Media und Editor </li>\n</ul>\n<p>WordPress-Installationen, bei denen die Hintergrund-Aktualisierung aktiv ist, werden innerhalb der kommenden 12 Stunden automatisch auf Version 3.9.1 aktualisiert. Nachdem die automatische Hintergrund-Aktualisierung durchgeführt wurde, erhält der Administrator eine Bestätigungs-E-Mail.</p>\n<p>Sofern die Hintergrund-Aktualisierung deaktiviert wurde, kann aus dem Administrationsbereich die Aktualisierung manuell eingeleitet werden. Für Nutzer, die manuell auf 3.9.1 upgraden möchten oder bei denen eine automatische Aktualisierung aus technischen Gründen nicht möglich ist, bieten wir ein Upgrade-Paket an, das alle geänderten Dateien zur direkten Vorgängerversion enthält.</p>\n<p><strong class="teaser">&raquo; <a href="http://wpde.org/files/2014/05/fix-39-to-391.zip"><strong> Download Upgradepaket von 3.9 auf 3.9.1</strong></a></strong></p>\n<p>Die offizielle englisch- und deutschsprachige Vollversion 3.9.1 kann im <a href="http://de.wordpress.org/wordpress-3.9.1-de_DE.zip">Downloadbereich</a> heruntergeladen werden. Weitere Informationen zu dieser Version finden sich im <a href="http://wordpress.org/news/2014/05/wordpress-3-9-1/">offiziellen Ankündigungsbeitrag</a> und im <a href="http://codex.wordpress.org/Version_3.9.1">Codex</a>.</p>\n<p><strong>Vor jeder Aktualisierung <span style="text-decoration: underline">unbedingt</span> ein <a href="http://faq.wpde.org/backup-von-wordpress-erstellen/">vollständiges Backup</a> aller Dateien und der Datenbank anlegen!</strong></p>\n<div style="margin: 20px 0pt;color: #c45500;font-size: 16px">Wir bitten euch, Support-Fragen zu der neuen Version im <a href="http://forum.wpde.org/">Forum</a> zu stellen. Dort findet ihr Hilfe falls bei euch Probleme auftauchen oder ihr Fragen im Vorfeld der Aktualisierung habt.</div>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:93:"http://blog.wpde.org/2014/05/08/wordpress-3-9-1-update-veroeffentlicht-upgradepaket.html/feed";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"9";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:48:"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:85:"Das WordCamp 2014 in Hamburg aktiv mitgestalten: Inhalte, Ideen &amp; Speaker gesucht";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:77:"http://blog.wpde.org/2014/04/30/wordcamp-2014-hamburg-aktiv-mitgestalten.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:86:"http://blog.wpde.org/2014/04/30/wordcamp-2014-hamburg-aktiv-mitgestalten.html#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 30 Apr 2014 09:30:00 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:3:{i:0;a:5:{s:4:"data";s:8:"WordCamp";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:9:"Community";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:9:"wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://blog.wpde.org/?p=2576";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:359:"Der Termin am 14. und 15. Juni rückt näher und damit das deutschsprachige WordPress-Event des Jahres. Ihr wollt zwei gelungene Tage beim WordCamp 2014 erleben? Dann bringt euch und eure Ideen mit ein! Wir sprachen mit dem Orga-Team des Camp darüber, was die Besucher in Hamburg erwartet. Gerne weitersagen: Es werden noch Speaker, helfende Hände [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:15:"Michael Firnkes";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:10798:"<p><strong class="teaser">Der Termin am 14. und 15. Juni rückt näher und damit das deutschsprachige WordPress-Event des Jahres. Ihr wollt zwei gelungene Tage beim <a href="http://2014.hamburg.wordcamp.org/" target="_blank">WordCamp 2014</a> erleben? Dann bringt euch und eure Ideen mit ein!</strong></p>\n<p><img src="http://blog.wpde.org/files/2014/04/wordcamp-hamburg-juni-2014.png" alt="WordCamp Hamburg Juni 2014" width="869" height="350" class="alignnone size-full wp-image-2602" /></p>\n<p>Wir sprachen mit dem <a href="http://2014.hamburg.wordcamp.org/orga/" target="_blank">Orga-Team des Camp</a> darüber, was die Besucher in Hamburg erwartet. Gerne weitersagen: Es werden noch Speaker, helfende Hände aber auch Sponsoren gesucht. Doch lest selbst:<span id="more-2576"></span></p>\n<h3>Die letzten deutschlandweiten WordPress-Treffen legten den Fokus nicht nur auf Entwickler-Themen, sondern auch auf Marketing, Design und ähnliche Bereiche. Was werden die Schwerpunkte in Hamburg sein?</h3>\n<p>Schwerpunkt <a href="http://2014.hamburg.wordcamp.org/" target="_blank">in Hamburg</a> wird die WordPress-Community selbst sein, was auch das Logo ausdrücken soll. So vielfältig wie unsere Community sind daher auch die Themen. Das geht von <strong>Theme-/Pluginentwicklung über die richtige Content-Strategie bis zur Nischenblog-Vorstellung</strong>. Mit WordPress arbeiten eben viele Menschen aus den unterschiedlichsten Fachrichtungen. Und diesen breit gefächerten Ansatz wollen wir weiter ausbauen.</p>\n<p>Deswegen auch die <strong>neuen Formate wie der <a href="http://2014.hamburg.wordcamp.org/speakers/lightning-talk/" target="_blank">Lightning Talk</a></strong>. Dieser beinhaltet Themen, die vielleicht nicht sessionfüllend, aber trotzdem wichtig sind. Das kann eine kurze Vorstellung einer kaum beachteten Funktion sein, oder eine lustig vorgetragene Beschwerde über etwas, was einen schon immer an WordPress genervt hat. Oder die Beantwortung der Frage: Warum funktioniert das eigentlich nicht in WordPress?</p>\n<p>Ebenfalls neu ist die <strong>Erweiterung auf zwei Tage und der <a href="http://2014.hamburg.wordcamp.org/ueber/contributor-day/" target="_blank">Contributor Day</a></strong> am Montag für alle, die am WordPress-Projekt mitarbeiten oder zukünftig mitarbeiten wollen. Auch hier richtet sich der Tag nicht nur an Experten. Alle EntwicklerInnen, TexterInnen, Supporter oder DesignerInnen, die ihre Fähigkeiten einsetzen möchten, sind eingeladen.</p>\n<h3>Ist das WordCamp 2014 in diesem Zusammenhang auch für reine AnwenderInnen und BloggerInnen spannend?</h3>\n<p>Auf jeden Fall. Unbedingt sogar. Die genaue Aufteilung der Sessions ist noch nicht abgeschlossen (<strong>reicht gerne noch schnell <a href="http://2014.hamburg.wordcamp.org/speakers/call-for-papers/" target="_blank">eure Session ein!</a></strong>), aber schon jetzt ist klar, dass auch AnwenderInnen ein spannendes Programm geboten bekommen. Neben den klassischen „Neben“-Themen, wie Content, Marketing, SEO und dergleichen, wird es vor allem Use Cases geben. Also Vorstellungen von individuellen, kreativen Lösungen rund um die Herausforderungen, einen Blog zu betreiben. Und eine <strong>Starter-Session für WordPress-AnfängerInnen</strong> gibt es natürlich auch.</p>\n<h3>Worauf dürfen wir uns freuen, gibt es hier schon erste Session-Ideen?</h3>\n<p>Die genauen Sessionpläne werden nächste Woche, nach der Deadline für die Einreichungen, von uns zu einem Programm zusammengestellt und dann auf dem <a href="http://2014.hamburg.wordcamp.org/" target="_blank">WordCamp-Blog</a> veröffentlicht. Ihr könnt euch auf jeden Fall auf ein spannendes Programm freuen!</p>\n<h3>Stichpunkt „Sessions“: ihr sucht noch nach Vorträgen aber auch kürzeren Formaten. Wer kann sich melden? Welche Themen für welche Bereiche sind noch gefragt?</h3>\n<p>Alle, die Lust haben, ihr Wissen zu teilen, können eine Session einreichen. Du musst dazu kein Experte/keine Expertin sein und die Weltformel parat haben. Es genügt, wenn du mit Spaß bei der Sache bist und etwas zu erzählen hast. Reine Plugin-Vorstellungen sind weniger gefragt als andere Blickwinkel, oder der kreative Umgang mit etwas.</p>\n<p>Wir haben schon viele spannende Session-Einreichungen bekommen. Im Bereich Design und Entwicklung für Profis war die Resonanz allerdings noch etwas zurückhaltend. <strong>Hier hoffen wir noch auf mehr spannende Sessions aus der Community.</strong> Wer Ideen benötigt, der kann einen <strong>Blick auf unsere <a href="http://2014.hamburg.wordcamp.org/speakers/call-for-papers/sessionideen/" target="_blank">Sessionideen-Seite</a></strong> werfen.</p>\n<h3>Was hat es mit den <a href="http://2014.hamburg.wordcamp.org/speakers/call-for-papers/" target="_blank">unterschiedlichen Vortrags-Formaten</a> auf sich? Können sich also auch Powerpoint-Präsentations-Geschädigte mit einem spannenden Thema melden? <img src="http://blog.wpde.org/wp-includes/images/smilies/icon_wink.gif" alt=";)" class="wp-smiley" /> </h3>\n<p>Nicht jedes Thema kann in 30 bis 45 Minuten abgehandelt werden. Beim <a href="http://wpcamp.de/1877/metameetup-session-2/" target="_blank">Meta-Meetup letztes Jahr</a> war die Zeit zu kurz, manch andere Sessions zog sich etwas in die Länge. Das liegt nicht unbedingt an den Vortragenden, sondern es kann sich auch einfach um das falsche Format für dieses Thema handeln.</p>\n<p>Wer hat sich nicht schon mal über Shortcodes geärgert oder über die typographisch falsche Umwandlung der Anführungszeichen – aber 30 Minuten damit füllen? <a href="http://2014.hamburg.wordcamp.org/speakers/lightning-talk/" target="_blank"><strong>Lightning Talks</strong></a> sind flexibler und ermöglichen auch EinsteigerInnen die Bühne zu erklimmen und ihr Thema anzusprechen. Darüber hinaus ist das ein guter Anknüpfungspunkt für weitere Gespräche auf dem Camp. Und Powerpoint muss man dazu auch nicht benutzen. <img src="http://blog.wpde.org/wp-includes/images/smilies/icon_smile.gif" alt=":)" class="wp-smiley" /> </p>\n<p><strong>Workshops</strong> dagegen schließen die Lücke auf der anderen Seite. Hier haben wir etwas mehr Zeit. Für mehr Interaktion, mehr Fragen, Übungen, schriftliche Tests … Das können die Vortragenden frei nutzen. Nur langweilen sollte er nicht, aber das gilt für jeden Vortrag. Und mit etwas Glück wird es auch eine Podiumsdiskussion geben.</p>\n<h3>Ebenso setzt ihr auf weitere <a href="http://2014.hamburg.wordcamp.org/sponsoring/" target="_blank">Unterstützung durch Sponsoren</a>. Für wen eignet sich hier das Format WordCamp? Und was könnt ihr im Gegenzug bieten?</h3>\n<p>Wir benötigen sogar noch dringend Sponsoren, um die Kosten zu decken. Unser Ticketpreis ist ja extra so niedrig angesetzt, damit alle sich diese zwei Tage leisten können, deckt aber lediglich das Catering ab. <strong>Das Camp eignet sich für viele Firmen</strong>: Klassischer Weise sind es vor allem Agenturen, die WordPress einsetzen, Software-Firmen auf Mitarbeitersuche, Hoster oder IT-Verlage. Aber auch für andere Firmen kann es sich lohnen. Wir haben <a href="http://2014.hamburg.wordcamp.org/sponsoring/" target="_blank">verschiedene Sponsorenpakete geschnürt</a>, da dürfte für jeden etwas dabei sein. Im Zweifelsfall sind wir offen für Ideen – einfach Kontakt mit uns aufnehmen, über einen der vielen Kanäle (<a href="https://twitter.com/wordcamphh" target="_blank">Twitter</a>, <a href="https://plus.google.com/104913765696333522730/" target="_blank">Google+</a>, <a href="https://www.facebook.com/WordCampHamburg" target="_blank">Facebook</a>, das <a href="http://2014.hamburg.wordcamp.org/kontakt/" target="_blank">Kontaktformular</a> oder hier in den Kommentaren).</p>\n<p>Wir bieten Aufmerksamkeit in der WordPress-Szene und bis zu 350 web-affine Menschen, die vielleicht einen neuen Job suchen oder dein neues Produkt ausprobieren wollen. Digitale Pioniere, die sich weiterbilden wollen und neugierig auf Neuigkeiten sind. Early Adopter gesammelt an einem Punkt. Aber in erster Linie ist dies eine <strong>Chance für Unternehmen, diese großartige Software zu unterstützen</strong>, die viele auch für ihre eigene Webseite nutzen.</p>\n<p>WordPress ist eine freie Software und das Sponsoring hilft – besonders mit dem <a href="http://2014.hamburg.wordcamp.org/ueber/contributor-day/" target="_blank">Contributor Day</a> – sie weiterzuentwickeln. Eine Agentur oder ein Hoster, der mit WordPress indirekt sein Geld verdient, hilft so dem Projekt und gibt etwas zurück. Beim WordCamp treffen sich viele Fachleute und ExpertInnen, die durch Ihre Arbeit WordPress zu dem machen, was es ist.</p>\n<h3>Ihr steckt sehr viel Arbeit in die Organisation. Wie kann euch die WordPress-Gemeinschaft sonst noch unterstützen?</h3>\n<p>In Kurzform: <strong>Feedback, Sessions, Lightning Talks, Sponsoren, HelferInnen</strong>. Ihr wünscht euch ein bestimmtes Thema auf dem Camp? Dann <a href="http://2014.hamburg.wordcamp.org/kontakt/" target="_blank">schreibt es uns</a> auf Twitter, Google+, Facebook oder als Kommentar im Blog. Ihr wollt einen bestimmten Speaker auf dem Camp sehen? Dann ebenso ran an die Tasten. Wir freuen uns über Ideen und Anregungen!</p>\n<p>Ihr seid <strong>WebdesignerInnen oder Frontend-EntwicklerInnen</strong>, dann <a href="http://2014.hamburg.wordcamp.org/speakers/bewerbung/" target="_blank">reicht gerne noch eine Session ein</a>, auch zu jedem anderen Thema kann noch eingereicht werden. Jeder weiß etwas, was noch nicht alle anderen auf dem Camp wissen, oder er hatte schon mal ein Problem mit WordPress, das man lösen möchte. Überlegt zum Beispiel, was euch als AnfängerInnen am meisten Probleme bereitet hat und macht dazu einen <a href="http://2014.hamburg.wordcamp.org/speakers/lightning-talk/" target="_blank">Lightning Talk</a>.</p>\n<p><strong>Ihr kennt jemanden, der als Sponsor passen würde?</strong> Leitet ihm gerne alle Infos weiter (das PDF findet ihr auf der <a href="http://2014.hamburg.wordcamp.org/sponsoring/" target="_blank">Sponsoring-Seite</a>). Auch konkrete Sachspenden oder Kostenübernahmen für bestimmte Posten sind möglich. Sprecht uns gerne dazu an! Vor Ort werden wir auf jeden Fall Hilfe benötigen. Wer Interesse hat, als Saal-Engel einen Raum zu betreuen oder die Videoaufnahmen für <a href="http://wordpress.tv/" target="_blank">WordPress.tv</a> zu machen, der kann sich <a href="http://2014.hamburg.wordcamp.org/kontakt/helfende-haende/" target="_blank">auf dieser Seite bei uns melden</a>.</p>\n<h3>Worauf freut ihr euch Mitte Juni am meisten?</h3>\n<p>KollegInnen und Kollegen wiederzusehen, tolle Sessions zu hören, auf ein ganzes Wochenende WordPress-Wahnsinn, sowie einen Contributor Day, bei dem wir WordPress für Deutschland noch einen Tick besser machen.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:82:"http://blog.wpde.org/2014/04/30/wordcamp-2014-hamburg-aktiv-mitgestalten.html/feed";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:54:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:101:"Gelöst: zu viele Umleitungen nach Update auf 3.9 bei WordPress Mulitsite mit Subdomain-Konfiguration";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:78:"http://blog.wpde.org/2014/04/22/umleitungen-nach-update-auf-3-9-multisite.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:87:"http://blog.wpde.org/2014/04/22/umleitungen-nach-update-auf-3-9-multisite.html#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 22 Apr 2014 07:46:56 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:5:{i:0;a:5:{s:4:"data";s:9:"Tutorials";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:19:"DOMAIN_CURRENT_SITE";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:9:"Multisite";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:11:"Umleitungen";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:4;a:5:{s:4:"data";s:13:"WordPress 3.9";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://blog.wpde.org/?p=2567";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:376:"Nach dem Update auf WordPress 3.9 trat in den letzten Tagen häufiger das Phänomen auf, dass sich die Hauptseite im Multisite-Netzwerk nicht mehr aufrufen ließ, sondern in einer Umleitungs-Schleife hing. Das hängt mit den umfangreichen Änderungen an der Art und Weise, wie Domains und Pfade innerhalb des WordPress Netzwerk aufgerufen werden. Siehe dazu auch den [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Birgit Olzem";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4030:"<p><strong class="teaser">Nach dem Update auf WordPress 3.9 trat in den letzten Tagen häufiger das Phänomen auf, dass sich die Hauptseite im Multisite-Netzwerk nicht mehr aufrufen ließ, sondern in einer Umleitungs-Schleife hing. Das hängt mit den umfangreichen Änderungen an der Art und Weise, wie Domains und Pfade innerhalb des WordPress Netzwerk aufgerufen werden. Siehe dazu auch den <a href="http://make.wordpress.org/core/2014/04/16/multisite-changes-in-3-9/" title="Multisite Changes in 3.9" target="_blank">ausführlichen Blogpost im Core-Make auf WordPress.org</a> (eng)</strong></p>\n<p><a href="http://blog.wpde.org/files/2014/04/umleitungs-problem-wordpress-multisite.png"><img src="http://blog.wpde.org/files/2014/04/umleitungs-problem-wordpress-multisite.png" alt="Browser Fehlermeldung bei Umleitungs Problem nach Update auf 3.9" width="565" height="200" class="aligncenter size-full wp-image-2568" /></a></p>\n<p><span id="more-2567"></span></p>\n<p>Die Ursache ist meistens in der Domainkonfiguration der Multisite zu finden. Im Falle einer Subdomain-basierten Installation wird www.domain.de zu domain.de/wp-signup.php?=www und wieder zurück auf www.domain.de umgeleitet usw. bis der Browser die Fehlermeldung ausspuckt. Es scheint so, dass www.domain.de (mit dem www Prefix) nun auch als Subdomain interpretiert wird. </p>\n<p>Auch wenn man in der wp-config.php die Variable <code>define( ''NOBLOGREDIRECT'', ''http://www.domain.de'' );</code> definiert hatte, wenn die Neuregistrierung einer weiteren Sub-Domain-Instanz innerhalb der Multisite deaktiviert ist, läuft die Umleitung ins Unendliche. </p>\n<p>Hier hilft nur ein Eingriff in die Datenbank, denn ins Backend kommt man natürlich auch nicht. Allerdings in die Subdomain-Instanzen, da hier dann keine Umleitung greifen muss. </p>\n<h2>Wie kann die unendliche Umleitung gelöst werden?</h2>\n<ol>\n<li>Login in die Datenbank (meist via phpMyAdmin)</li>\n<li>komplettes Datenbank-Backup erstellen</li>\n<li>in der Tabelle <strong><em>wp_blogs</em></strong> den Eintrag der ersten Domain ändern von domain.de auf www.domain.de &#8211; also mit www Präfix!</li>\n<li>in der Tabelle <strong><em>wp_options</em></strong> die Einträge in <strong><em>siteurl</em></strong> und <strong><em>home</em></strong> in http://www.domain.de umstellen (hier auch mit www Präfix)</li>\n<li>nun muss ein Zeile in der wp-config.php geändert werden <code>define(''DOMAIN_CURRENT_SITE'', ''www.domain.de'');</code>, somit wird die Konstante DOMAIN_CURRENT_SITE gleich gesetzt mit der Domain in der Tabelle wp_blogs </li>\n<li>als letzter Schritt ist eine Änderung an der .htaccess notwendig: unter <code>RewriteEngine on</code> wird die Datei um folgende Zeilen ergänzt:<br />\n<code>RewriteCond %{HTTP_HOST} ^domain.de$<br />\nRewriteRule (.*) http://www.domain.de/$1 [R=301,L]</code>\n</ol>\n<p>Nach diesen Schritten sollte eurer Frontend sowie Backend der Hauptdomain eurer Multisite wieder normal erreichbar sein. </p>\n<p>Für den Fall, dass die Multisite auf Basis von Unterverzeichnissen installiert wurde, weise ich darauf hin, dass es zu Problemen nach dem Update kommen kann, wenn der Verzeichnis-Pfad Großbuchstaben enthält. (s. auch hier das Ticket <a href="https://core.trac.wordpress.org/ticket/27866" target="_blank">https://core.trac.wordpress.org/ticket/27866</a>)</p>\n<p>Weitere bekannte Konflikte und Probleme, die nach dem Update auf 3.9 auftreten können, werden im Support-Forum auf WordPress.org gesammelt: <a href="https://wordpress.org/support/topic/wordpress-39-master-list" target="_blank">https://wordpress.org/support/topic/wordpress-39-master-list</a></p>\n<p>Wie bei jedem großen Versions-Sprung gilt immer die Regel: <strong>BACKUPS</strong> erstellen VOR dem Aktualisieren. Am Besten im Vorfeld auf einer identischen Kopie der Live-Seite sämtliche Updates testen. Das Grundsystem von WordPress wird in der Regel gründlich getestet, oft treten Konflikte mit Plugins und Themes auf, die noch nicht die betreffenden Änderungen übernommen haben. </p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:83:"http://blog.wpde.org/2014/04/22/umleitungen-nach-update-auf-3-9-multisite.html/feed";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"6";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:48:"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:41:"WordPress 3.9 „Smith“ veröffentlicht";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:72:"http://blog.wpde.org/2014/04/16/wordpress-3-9-smith-veroeffentlicht.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:81:"http://blog.wpde.org/2014/04/16/wordpress-3-9-smith-veroeffentlicht.html#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 16 Apr 2014 18:34:38 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:3:{i:0;a:5:{s:4:"data";s:7:"Release";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:11:"Jimmy Smith";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:13:"WordPress 3.9";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://blog.wpde.org/?p=2521";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:444:"WordPress 3.9 „Smith“ wurde veröffentlicht! Diese Version ist dem Jazz-Organisten Jimmy Smith gewidmet. Die offizielle englischsprachige Version, sowie die deutschsprachige Version stehen hier zum Download bereit. Auch die deutschsprachige Version, die über die automatische Aktualisierung ausgeliefert wird, ist ab sofort verfügbar. Wie bei jedem großen Versions-Sprung, gibt es auch zu diesem Release kein Upgradepaket. Eine [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Birgit Olzem";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:11998:"<p><strong class="teaser"><a href="http://wordpress.org/news/2014/04/smith/">WordPress 3.9 „Smith“ wurde veröffentlicht</a>! Diese Version ist dem Jazz-Organisten <a href="http://de.wikipedia.org/wiki/Jimmy_Smith">Jimmy Smith</a> gewidmet. Die offizielle englischsprachige Version, sowie die deutschsprachige Version stehen <a href="http://wpde.org/download" title="zur Downloadseite ">hier zum Download</a> bereit. Auch die deutschsprachige Version, die über die automatische Aktualisierung ausgeliefert wird, ist ab sofort verfügbar.</strong></p>\n<p>Wie bei jedem großen Versions-Sprung, gibt es auch zu diesem Release kein Upgradepaket. Eine Aktualisierung müsst ihr entweder automatisch aus dem Administrationsbereich durchführen oder ihr ladet euch das Release runter und führt es manuell durch. Auf de.wordpress.org haben wir die Sprachdateien bereits eingespielt, nach einer automatischen Aktualisierung bleiben alle Bereiche deutschsprachig.</p>\n<p>Eine ausführliche Auflistung aller Neuigkeiten findet ihr im <a href="http://codex.wordpress.org/Version_3.9">Codex</a>.</p>\n<p><span id="more-2521"></span></p>\n<h2>einige Highlights der Version 3.9</h2>\n<h3>Visueller Editor (WYSIWYG) wurde verbessert</h3>\n<p><a href="http://blog.wpde.org/files/2014/04/visual-editor.png"><img src="http://blog.wpde.org/files/2014/04/visual-editor-150x140.png" alt="visual-editor" width="150" height="140" class="alignleft size-thumbnail wp-image-2553" /></a>Die Geschwindigkeit der Bearbeitung, die Zugänglichkeit und die Unterstützung mobiler Endgeräte wurde optimiert. Texte, die aus dem Textverarbeitungsprogramm Microsoft Word kopiert wurden, können nun ohne Umwege im Editor eingefügt werden, ohne das (oft) chaotische Styling von MS Word manuell nachbereiten zu müssen. </p>\n<p><span class="clear" /></p>\n<h3>Die Medienbearbeitung wird runder und geschmeidiger</h3>\n<p><a href="http://blog.wpde.org/files/2014/04/galerie-bearbeiten.png"><img src="http://blog.wpde.org/files/2014/04/galerie-bearbeiten.png" alt="galerie-bearbeiten" width="745" height="511" class="aligncenter size-full wp-image-2536" /></a></p>\n<p><a href="http://blog.wpde.org/files/2014/04/image.jpg"><img src="http://blog.wpde.org/files/2014/04/image-150x150.jpg" alt="image" width="150" height="150" class="alignleft size-thumbnail wp-image-2529" /></a><strong>Einfache Bildbearbeitung</strong><br />\nMit schnellerem Zugriff auf die Zuschneide-und Drehwerkzeuge, ist es viel einfacher, Bilder innerhalb von WordPress zu bearbeiten &#8211; während des Bearbeitens der Inhalte. Du kannst Bilder nun auch direkt im Editor skalieren, um genau die richtige Passform zu finden.</p>\n<p><span class="clear" /></p>\n<p><a href="http://blog.wpde.org/files/2014/04/drop.jpg"><img src="http://blog.wpde.org/files/2014/04/drop-150x150.jpg" alt="drop" width="150" height="150" class="alignleft size-thumbnail wp-image-2526" /></a><strong>Drag &amp; Drop für Bilder im Editor</strong><br />\nWas auf dem Desktop schon Standard ist, zieht nun auch in WordPress ein. Das Hochladen der Bilder wird nun viel einfacher und geschmeidiger im Arbeitsablauf, als je zuvor. Einfach die Bilder vom lokalen Speicherplatz / Ordner direkt in den Editor ziehen und dort an Ort und Stelle fallen lassen. Der Schritt über die Funktion „Dateien hinzufügen“ kann nun ausgelassen werden. </p>\n<p><span class="clear" /></p>\n<p><a href="http://blog.wpde.org/files/2014/04/galerie.png"><img src="http://blog.wpde.org/files/2014/04/galerie-150x150.png" alt="galerie" width="150" height="150" class="alignleft size-thumbnail wp-image-2540" /></a><strong>Galerie Vorschau im Editor</strong><br />\nBisher sah man nach dem Einfügen einer Galerie lediglich einen Platzhalter im Editor. Seit dieser Version wird die Galerie direkt im Editor wie auch im Frontend als Grid angezeigt. </p>\n<p><span class="clear" /></p>\n<p><a href="http://blog.wpde.org/files/2014/04/audio-wiedergabeliste-editor.png"><img src="http://blog.wpde.org/files/2014/04/audio-wiedergabeliste-editor-150x150.png" alt="audio-wiedergabeliste-editor" width="150" height="150" class="alignleft size-thumbnail wp-image-2541" /></a><strong>Playlisten für deine Audios und Videos</strong><br />\nÄhnlich der Galerien für Bilder, kannst du nun sogenannte Playlisten für deine Videos und Audios anlegen um Musik und Videos zu präsentieren. </p>\n<p><span class="clear" /></p>\n<h3>Live-Vorschau im  Theme-Customizer und verbesserter Theme-Browser</h3>\n<p><a href="http://blog.wpde.org/files/2014/04/theme-customizer1.png"><img src="http://blog.wpde.org/files/2014/04/theme-customizer1-150x150.png" alt="theme-customizer" width="150" height="150" class="alignleft size-thumbnail wp-image-2548" /></a><strong>Widgets und Header live austauschen</strong><br />\nBeim Anpassen von Themes, die den Theme-Customizer unterstützen, können nur auch Header-Bilder und Widgets direkt in der Live-Vorschau ausgewechselt werden. Dies macht es einfacher das Aussehen vor dem endgültigen Speichern zu testen. </p>\n<p><strong>Themes auswählen wird zum Erlebnis</strong><br />\nDer Theme-Browser wurde nochmals verbessert. Themes aus dem WordPress.org Theme-Verzeichnis können einfacher gesucht und installiert werden, als je zuvor. </p>\n<h2>Download &amp; wichtige Hinweise</h2>\n<p>Die offizielle englischsprachige Version kann im <a href="http://wpde.org/download/englisch/">Downloadbereich</a> heruntergeladen werden und die offizielle deutschsprachige Version steht auf <a href="http://de.wordpress.org/">de.wordpress.org</a> zur Verfügung.</p>\n<div style="padding:20px 0;font-size:17px"><strong>&raquo;</strong> <a href="http://wpde.org/download/"><strong>Download WordPress 3.9 DE</strong></a></div>\n<p>Beachtet bitte unbedingt die Mindestvoraussetzungen von WordPress! PHP muss mindestens in Version 5.2.4 vorliegen, MySQL in Version 5.0.15. Ein Upgrade ist sonst weder möglich, noch empfehlenswert.</p>\n<p>WordPress 3.9 (DE) enthält insgesamt sechs Sprachdateien in informeller Anrede (&#8220;Du&#8221;), die in der DE-Edition und der offiziellen deutschsprachigen Version bereits enthalten sind: Die Hauptsprachdatei mit der separaten Sprachdatei für Kontinente und Städte, die Sprachdatei für die Administration, die Sprachdatei für die Netzwerk Administration und die Sprachdateien für die Standardthemes. Die informellen (&bdquo;Du&ldquo;) und formellen (&bdquo;Sie&ldquo;) Sprachdateien können im <a href="http://wpde.org/download/sprachdatei/">Downloadbereich</a> auch einzeln heruntergeladen werden. </p>\n<p><strong><u>Bitte achtet unbedingt darauf, vor der manuellen oder automatischen Aktualisierung eine vollständige <a href="http://faq.wpde.org/backup-von-wordpress-erstellen/">Datensicherung</a> anzulegen. Das beinhaltet alle Dateien auf eurem Webspace und ein vollständiges Backup der Datenbank.</u></strong></p>\n<p><strong>Bitte wendet euch mit Fragen oder Problemen an das <a href="http://forum.wpde.org/">Forum</a>. Dort findet ihr Hilfe, falls bei euch Probleme auftauchen, ihr Fragen im Vorfeld der Aktualisierung habt oder Unterstützung zu den neuen Funktionen benötigt.</strong></p>\n<p>In der <a href="http://faq.wpde.org/">FAQ</a> findet ihr viele Informationen und Hilfetexte, unter anderem zur <a href="http://wpde.org/installation">Installation</a> und zum <a href="http://faq.wpde.org/backup-von-wordpress-erstellen/">Anlegen eines Backups</a>. Weitere Hilfe findet ihr in unserem <a href="http://forum.wpde.org/">Support-Forum</a>, im offiziellen <a href="http://wordpress.org/support/">englischsprachigen Forum</a>, in unserem <a href="http://blog.wpde.org/2007/02/02/irc-channel-wordpress-deutschland.html">IRC-Channel</a> unter <em>#wordpress-deutschland</em> oder im englischsprachigen Channel <em>#wordpress</em> (beide irc.freenode.net). </p>\n<p>Solltet ihr Fehler in der Sprachdatei finden, so meldet sie bitte <a href="http://forum.wpde.org/sprachdatei/">hier im Forum</a>. Gerne könnt ihr Vorschläge direkt im GlotPress eintragen. Siehe dazu auch unseren Blogbeitrag: <a href="http://blog.wpde.org/2013/06/03/wordpress-auf-deutsch-hilf-mit.html" title="WordPress auf Deutsch – hilf mit!">WordPress auf Deutsch &#8211; hilf mit!</a></p>\n<p><strong>Wir bedanken uns bei allen Mitwirkenden, die dieses Release möglich gemacht haben und mit Ihrer unermüdlichen Arbeit WordPress weiter entwickeln, sowie allen fleißigen Helfern, die es uns ermöglichen zeitnah die deutsche Version bereitzustellen &#8211; vielen Dank!</strong> </p>\n<h4>Aktive Übersetzer / Validatoren der Version 3.9</h4>\n<ul id="wp-people-group-validators">\n<li id="wp-person-coachbirgit">\n		<a href="http://profiles.wordpress.org/coachbirgit"><img src="https://secure.gravatar.com/avatar/d4de4c5b40652625329d34e5391fc9b5?s=30" class="gravatar" alt="Birgit Olzem"></a><br />\n		<a class="web" href="http://profiles.wordpress.org/coachbirgit">Birgit Olzem</a>\n	</li>\n<li id="wp-person-ocean90">\n		<a href="http://profiles.wordpress.org/ocean90"><img src="https://secure.gravatar.com/avatar/3e8e161d97d793bd8fc2dcd62583bb76?s=30" class="gravatar" alt="Dominik Schilling (ocean90)"></a><br />\n		<a class="web" href="http://profiles.wordpress.org/ocean90">Dominik Schilling (ocean90)</a>\n	</li>\n<li id="wp-person-zodiac1978">\n		<a href="http://profiles.wordpress.org/zodiac1978"><img src="https://secure.gravatar.com/avatar/c82f3ac01fcf49e733b482214c7483cd?s=30" class="gravatar" alt="Torsten Landsiedel"></a><br />\n		<a class="web" href="http://profiles.wordpress.org/zodiac1978">Torsten Landsiedel</a>\n	</li>\n<li id="wp-person-nullbyte">\n	<a href="http://profiles.wordpress.org/nullbyte"><img src="https://secure.gravatar.com/avatar/782dd6ceec537f2a878f6b31fcdcb8f1?s=30" class="gravatar" alt="Robert Windisch"></a><br />\n	<a class="web" href="http://profiles.wordpress.org/nullbyte">Robert Windisch</a>\n	</li>\n<li id="wp-person-swissky">\n		<a href="http://profiles.wordpress.org/swissky"><img src="https://secure.gravatar.com/avatar/37390e548c9592c15d93cffed03c9f47?s=30" class="gravatar" alt="Kevin Kyburz (@swissky)"></a><br />\n		<a class="web" href="http://profiles.wordpress.org/swissky">Kevin Kyburz (@swissky)</a>\n	</li>\n</ul>\n<h4>Mit-Übersetzer:</h4>\n<p><a href="http://profiles.wordpress.org/daveshine">David Decker</a>, <a href="http://profiles.wordpress.org/frank-klein">Frank Klein</a>, <a href="http://profiles.wordpress.org/glueckpress">Caspar Hübinger</a>, <a href="http://profiles.wordpress.org/jortmann">jortmann</a>, <a href="http://profiles.wordpress.org/obenland">Konstantin Obenland</a>, <a href="http://profiles.wordpress.org/lynk">lynk</a>, <a href="http://profiles.wordpress.org/alphawolf">Oliver Schloebe</a>, <a href="http://profiles.wordpress.org/pixolin">pixolin</a><span style="color: #444444"> und </span><a href="http://profiles.wordpress.org/sergejmueller">Sergej Müller</a></p>\n<p>Wer alles aktiv an der Entwicklung und Übersetzung beteiligt war, kann man jederzeit im Administrationsbereich unter /wp-admin/credits.php abrufen.</p>\n<h3>Hinweis</h3>\n<p>Zum Schluss noch ein Hinweis in Bezug auf die hier bisher angebotene Community-Edition: Seit dem Release 3.8 werden wir bis auf Weiteres keine spezielle <em>DE-Edition</em> mehr anbieten. Die neuste Version der deutsch-sprachigen WordPress Version wird nun direkt von de.wordpress.org zum Download angeboten.<br />\nDie Community-Edition wurde vor etlichen Jahren aus dem Umstand heraus angeboten, dass nicht alle Texte in WordPress durch die Sprachdatei übersetzt wurden. Es war also nötig, etliche Texte direkt in den Dateien zu übersetzen. Im Laufe der Jahre wurden das in der Weiterentwicklung immer stärker berücksichtigt und glücklicherweise werden mittlerweile alle Texte durch die Sprachdatei übersetzt. Es gibt also auf Dateiebene keinen Unterschied mehr zwischen der deutsch- und der englischsprachigen Version. Damit ist die Grundlage für eine spezielle DE-Edition nicht mehr gegeben. </p>\n<p>Wir wünschen euch viel Vergnügen mit WordPress 3.9 „Smith“!</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:77:"http://blog.wpde.org/2014/04/16/wordpress-3-9-smith-veroeffentlicht.html/feed";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:2:"33";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:43:"WordPress 3.8.3 und Upgradepaket verfügbar";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:80:"http://blog.wpde.org/2014/04/14/wordpress-3-8-3-und-upgradepaket-verfuegbar.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:89:"http://blog.wpde.org/2014/04/14/wordpress-3-8-3-und-upgradepaket-verfuegbar.html#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 14 Apr 2014 21:39:42 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:7:"Release";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://blog.wpde.org/?p=2515";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:451:"WordPress 3.8.3 wurde veröffentlicht. Mit dieser Version wird ein Fehler beim Speichern von Einträgen des Dashboard-Widgets &#8220;Schneller Entwurf&#8221; behoben. Eine Aktualisierung auf die neue Version 3.8.3 wird empfohlen. WordPress Installationen, bei denen die Hintergrundaktualisierung aktiv ist, werden innerhalb der kommenden 12 Stunden automatisch auf Version 3.8.3 aktualisiert &#8211; dies gilt ebenfalls für Nutzer, die noch [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Robert W.";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2237:"<p><strong class="teaser"><a href="http://wordpress.org/news/2014/04/wordpress-3-8-3/">WordPress 3.8.3 wurde veröffentlicht</a>. Mit dieser Version wird ein Fehler beim Speichern von Einträgen des Dashboard-Widgets &#8220;Schneller Entwurf&#8221; behoben. Eine Aktualisierung auf die neue Version 3.8.3 wird empfohlen.</strong></p>\n<p>WordPress Installationen, bei denen die Hintergrundaktualisierung aktiv ist, werden innerhalb der kommenden 12 Stunden automatisch auf Version 3.8.3 aktualisiert &#8211; dies gilt ebenfalls für Nutzer, die noch den Versionsstrang 3.7 verwenden, hier wird automatisch auf 3.7.3 aktualisiert. Nachdem die automatische Hintergrundaktualisierung durchgeführt wurde, erhält der Administrator eine Bestätigungsemail.</p>\n<p>Sofern die Hintergrundaktualisierung deaktiviert wurde, kann aus dem Administrationsbereich die Aktualisierung manuell eingeleitet werden. Für Nutzer die manuell auf 3.8.3 bzw. 3.7.3 upgraden möchten oder bei denen eine automatische Aktualisierung aus technischen Gründen nicht möglich ist, bieten wir ein Upgradepaket an, das alle geänderten Dateien zur direkten Vorgängerversion enthält.</p>\n<p><strong class="teaser">&raquo; <a href="http://wpde.org/files/2014/04/fix-382-to-383.zip"><strong> Download Upgradepaket von 3.8.2 auf 3.8.3</strong></a></strong></p>\n<p>Die offizielle englisch- und deutschsprachige Vollversion 3.8.3 kann im <a href="http://wpde.org/download//">Downloadbereich</a> runtergeladen werden. Weitere Informationen zu dieser Version finden sich im <a href="http://wordpress.org/news/2014/04/wordpress-3-8-3/">offiziellen Ankündigungsbeitrag</a> und im <a href="http://codex.wordpress.org/Version_3.8.3">Codex</a>.</p>\n<p><strong>Vor jeder Aktualisierung <span style="text-decoration: underline">unbedingt</span> ein <a href="http://faq.wpde.org/backup-von-wordpress-erstellen/">vollständiges Backup</a> aller Dateien und der Datenbank anlegen!</strong></p>\n<div style="margin: 20px 0pt;color: #c45500;font-size: 16px">Wir bitten euch, Support-Fragen zu der neuen Version im <a href="http://forum.wpde.org/">Forum</a> zu stellen. Dort findet ihr Hilfe falls bei euch Probleme auftauchen oder ihr Fragen im Vorfeld der Aktualisierung habt.</div>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:85:"http://blog.wpde.org/2014/04/14/wordpress-3-8-3-und-upgradepaket-verfuegbar.html/feed";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"6";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:48:"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:66:"Jetpack Plugin mit kritischer Sicherheitslücke – Bitte Updaten!";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:98:"http://blog.wpde.org/2014/04/10/jetpack-plugin-mit-kritischer-sicherheitsluecke-bitte-updaten.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:107:"http://blog.wpde.org/2014/04/10/jetpack-plugin-mit-kritischer-sicherheitsluecke-bitte-updaten.html#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 10 Apr 2014 20:17:43 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:3:{i:0;a:5:{s:4:"data";s:7:"Plugins";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:7:"jetpack";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:18:"Sicherheitsrelease";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://blog.wpde.org/?p=2508";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:425:"Jetpack 2.9.3 beinhaltet ein Update für eine kritischer Sicherheitslücke. Ein Update wird dringendst empfohlen. Aktualisieren kannst Du entweder über das Dashboard oder Jetpack manuell hier herunterladen (zip). Soeben wurde im offiziellen Jetpack Blog bekannt gegeben, dass in den Jetpack Versionen ab Version 1.9 (Oktober 2012) eine kritische Sicherheitslücke mit der Nummer CVE-2014-0173 besteht. Diese Lücke [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:17:"Dominik Schilling";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1930:"<p>Jetpack 2.9.3 beinhaltet ein Update für eine kritischer Sicherheitslücke. Ein Update wird dringendst empfohlen. Aktualisieren kannst Du entweder über das Dashboard oder <a href="http://downloads.wordpress.org/plugin/jetpack.2.9.3.zip">Jetpack manuell hier herunterladen</a> (zip).</p>\n<p>Soeben wurde im <a href="http://jetpack.me/2014/04/10/jetpack-security-update/">offiziellen Jetpack Blog bekannt gegeben</a>, dass in den Jetpack Versionen ab Version 1.9 (Oktober 2012) eine kritische Sicherheitslücke mit der Nummer CVE-2014-0173 besteht. Diese Lücke wurde durch einen internen Sicherheits-Audit erkannt und erlaubt es einen Angreifer die Zugangskontrollen zu umgehen um so Beiträge zu veröffentlichen.</p>\n<p><span id="more-2508"></span></p>\n<p>Es ist nicht bekannt, ob diese Sicherheitslücke bereits ausgenutzt wurde, da sie aber nun veröffentlicht wurde, ist es nur eine Frage der Zeit, bis die ersten Exploits veröffentlicht werden.</p>\n<p>Für der Umgang mit der Sicherheitslücke wurde eng mit dem Sicherheitsteam für WordPress zusammengearbeitet. Jetpack (ab Version 1.9) ist das erste Plugin, welches durch WordPress und seinen automatischen Aktualisierungsprozess auf die aktuellste Version aktualisiert wird. Dieser Prozess ist bereits seit etwa 10 Stunden aktiv.</p>\n<p>Jetpack ist eins der meistgenutzten Plugins mit aktuell 9,5 Millionen Downloads und ist eine Sammlung von Tools für WordPress, die das selbstgehostete Blog mit Funktionen der Blogging-Plattform WordPress.com anreichern.</p>\n<blockquote><p>\nFinding and fixing bugs is a key part of software development. I can’t promise there will never be another issue like this, but I can promise that when a problem is found we will do everything in our power to protect as many people as possible, as quickly as possible. We care deeply about each and every WordPress user.</p>\n<p>– George Stephanis, Jetpack Entwickler\n</p></blockquote>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:103:"http://blog.wpde.org/2014/04/10/jetpack-plugin-mit-kritischer-sicherheitsluecke-bitte-updaten.html/feed";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:48:"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:32:"WordPress 3.9 RC1 ist verfügbar";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:69:"http://blog.wpde.org/2014/04/09/wordpress-3-9-rc1-ist-verfuegbar.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:78:"http://blog.wpde.org/2014/04/09/wordpress-3-9-rc1-ist-verfuegbar.html#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 09 Apr 2014 17:27:53 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:3:{i:0;a:5:{s:4:"data";s:7:"Release";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:17:"Release Candidate";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:13:"WordPress 3.9";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://blog.wpde.org/?p=2502";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:403:"Der erste Release Kandidat von WordPress 3.9 wurde veröffentlicht. Die Entwickler erwarten das finale Release am 16. April. Wer diese Entwicklerversion testen möchte, kann sich das &#8220;WordPress Beta Tester Plugin&#8221; installieren oder sich die Version hier runterladen (zip). Wir weisen darauf hin, dass dies noch eine vorläufige Version ist, die noch nicht für den Produktiveinsatz [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:17:"Dominik Schilling";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1784:"<p><strong class="teaser">Der erste Release Kandidat von WordPress 3.9 wurde veröffentlicht. Die Entwickler erwarten das finale Release am 16. April. </strong> </p>\n<p><span id="more-2502"></span></p>\n<p>Wer diese Entwicklerversion testen möchte, kann sich das &#8220;<a href="http://wordpress.org/extend/plugins/wordpress-beta-tester/">WordPress Beta Tester Plugin</a>&#8221; installieren oder sich die Version <a href="http://wordpress.org/wordpress-3.9-RC1.zip">hier runterladen</a> (zip). </p>\n<p>Wir weisen darauf hin, dass dies noch eine vorläufige Version ist, die noch nicht für den Produktiveinsatz auf live geschalteten Webseiten genutzt werden sollte. </p>\n<p>Plugin-Autoren sollen ein besonderes Augenmerk auf den TinyMCE Editor legen. TinyMCE erhielt ein großes Update auf die Version 4.0. Plugins, die für TinyMCE 3.x geschrieben sind, benötigen unter Umständen einige Anpassungen. Für mehr, siehe den TinyMCE <a href="http://www.tinymce.com/wiki.php/Tutorial:Migration_guide_from_3.x">Migrationsführer</a> oder die <a href="http://www.tinymce.com/wiki.php/api4:index">API-Dokumentation</a>. Zusätzlich können die Hinweise im <a href="http://make.wordpress.org/core/2014/01/18/tinymce-4-0-is-in-core/">Entwickler-Blog</a> helfen.<br />\nWordPress 3.9 nutzt außerdem die MySQLi-Erweiterung für Websites mit PHP 5.5. Alle Plugins, die direkte Anrufe über die  <code>mysql_*</code> Funktionen nutzen, werden einige Probleme auf diesen Seiten haben. Für weitere Informationen, siehe die Hinweise im <a href="http://make.wordpress.org/core/2014/04/07/mysql-in-wordpress-3-9/">Entwickler-Blog</a></p>\n<p>Weitere Informationen finden sich im offiziellen <a href="http://wordpress.org/news/2014/04/wordpress-3-9-release-candidate/">Ankündigungsbeitrag</a>. </p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:74:"http://blog.wpde.org/2014/04/09/wordpress-3-9-rc1-ist-verfuegbar.html/feed";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:45:"WordPress 3.8.2 Sicherheitsversion verfügbar";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:82:"http://blog.wpde.org/2014/04/08/wordpress-3-8-2-sicherheitsversion-verfuegbar.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:91:"http://blog.wpde.org/2014/04/08/wordpress-3-8-2-sicherheitsversion-verfuegbar.html#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pub