ische Hintergrundaktualisierung durchgeführt wurde, erhält der Administrator eine Bestätigungsemail.</p>\n<p>Sofern die Hintergrundaktualisierung deaktiviert wurde, kann aus dem Administrationsbereich die Aktualisierung manuell eingeleitet werden. Für Nutzer die manuell auf 3.8.2 bzw. 3.7.2 upgraden möchten oder bei denen eine automatische Aktualisierung aus technischen Gründen nicht möglich ist, bieten wir ein Upgradepaket an, das alle geänderten Dateien zur direkten Vorgängerversion enthält.</p>\n<p><strong class="teaser">&raquo; <a href="http://wpde.org/files/2014/04/fix-381-to-382.zip"><strong> Download Upgradepaket von 3.8.1 auf 3.8.2</strong></a></strong></p>\n<p>Die offizielle englisch- und deutschsprachige Vollversion 3.8.2 kann im <a href="http://wpde.org/download//">Downloadbereich</a> runtergeladen werden. Weitere Informationen zu dieser Version finden sich im <a href="http://wordpress.org/news/2014/04/wordpress-3-8-2/">offiziellen Ankündigungsbeitrag</a> und im <a href="http://codex.wordpress.org/Version_3.8.2">Codex</a>.</p>\n<p><strong>Vor jeder Aktualisierung <span style="text-decoration: underline">unbedingt</span> ein <a href="http://faq.wpde.org/backup-von-wordpress-erstellen/">vollständiges Backup</a> aller Dateien und der Datenbank anlegen!</strong></p>\n<div style="margin: 20px 0pt;color: #c45500;font-size: 16px">Wir bitten euch, Support-Fragen zu der neuen Version im <a href="http://forum.wpde.org/">Forum</a> zu stellen. Dort findet ihr Hilfe falls bei euch Probleme auftauchen oder ihr Fragen im Vorfeld der Aktualisierung habt.</div>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:87:"http://blog.wpde.org/2014/04/08/wordpress-3-8-2-sicherheitsversion-verfuegbar.html/feed";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/module