onen werden ausschließlich zu Testzwecken veröffentlicht und sollten [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Olaf Schmitz";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:762:"<p><a href="http://wordpress.org/news/2014/03/wordpress-3-9-beta-2/">WordPress 3.9 Beta 2</a> steht zum testen bereit und enthält über <a href="https://core.trac.wordpress.org/log?rev=27639&#038;stop_rev=27500&#038;limit=200">100 Änderungen</a> zur Beta 1. Wenn du einen Fehler findest, kannst du ihn im <a href="http://wordpress.org/support/forum/alphabeta">Alpha/Beta Bereich</a> des WordPress.org Forums melden oder einen <a href="https://make.wordpress.org/core/reports/">Bug-Report im Trac anlegen</a> &#8211; dort findest du auch eine <a href="http://core.trac.wordpress.org/tickets/major">Liste der bekannten Fehler</a>. Beta-Versionen werden ausschließlich zu Testzwecken veröffentlicht und sollten nicht im produktiven Umfeld engesetzt werden!</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:78:"http://blog.wpde.org/2014/03/20/wordpress-3-9-beta-2-veroeffentlicht.html/feed";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:33:"Kommende Meetups in deiner Region";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:70:"http://blog.wpde.org/2014/03/17/kommende-meetups-in-deiner-region.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:79:"http://blog.wpde.org/2014/03/17/kommende-meetups-in-deiner-region.html#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 17 Mar 2014 10:06:45 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:7:"Meetups";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://blog.wpde.org/?p=2481";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:376:"Die lokalen Meetup-Treffen in Deutschland weiten sich aus, wenn du aus der Region kommst und dich für WordPress interessierst bist du immer herzlich Willkommen, Vorkenntnisse werden nicht vorausgesetzt. Wenn du interesse hast in deiner Region ein eigenes Meetup einzurichten, kannst du dich jederzeit an die alten Hasen wenden, die dir gerne Tipps und Tricks geben. [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Olaf Schmitz";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1920:"<p><strong class="teaser">Die lokalen Meetup-Treffen in Deutschland weiten sich aus, wenn du aus der Region kommst und dich für WordPress interessierst bist du immer herzlich Willkommen, Vorkenntnisse werden nicht vorausgesetzt.</strong></p>\n<p>Wenn du interesse hast in deiner Region ein eigenes Meetup einzurichten, kannst du dich jederzeit an die alten Hasen wenden, die dir gerne Tipps und Tricks geben. Im Forum findest du auch einen eigenen <a href="http://forum.wpde.org/wordpress-meetups/">Bereich zu Meetups</a>.</p>\n<p><strong class="teaser">Anstehende Termine:</strong></p>\n<ul>\n<li><a href="http://www.meetup.com/WordPress-Meetup-Koln/events/166933042/">Köln &#8211; Dienstag, den 18. März um 18:30 Uhr.</a></li>\n<li><a href="http://wpmeetup-potsdam.de/">Potsdam, Berlin und Umgebung &#8211; Dienstag, den 18. März um 18:30 Uhr.</a></li>\n<li><a href="http://www.wpmeetup-osnabrueck.de/">Osnabrück, Münster und das Emsland &#8211; Mittwoch den 19. März um 19 Uhr.</a></li>\n<li><a href="http://wpmeetup-franken.de/">Franken &#8211; Donnerstag, den 20. März um 19:00 Uhr.</a></li>\n<li><a href="http://wpmeetup-hamburg.de/">Hamburg &#8211; Dienstag, den 25. März um 19.00 Uhr</a></li>\n<li><a href="http://wpmeetup-berlin.de/">Berlin &#8211; Donnerstag den 27. März um 19:00.</a></li>\n</ul>\n<p>Für die folgenden Meetups liegen noch keine Termine vor:</p>\n<ul>\n<li>Chemnitz: <a href="http://wpmeetup-chemnitz.de">http://wpmeetup-chemnitz.de</a></li>\n<li>Frankfurt: <a href="http://wpmeetup-frankfurt.de">http://wpmeetup-frankfurt.de</a></li>\n<li>Hannover: <a href="http://wpmeetup-hannover.de">http://wpmeetup-hannover.de</a></li>\n<li>München: <a href="http://wpmeetup-muenchen.org">http://wpmeetup-muenchen.org</a></li>\n<li>Stuttgart: <a href="http://wpmeetup-stuttgart.de">http://wpmeetup-stuttgart.de</a></li>\n</ul>\n<p><strong>Wir wünschen den kommenden Meetups viel Spass und Erfolg!</strong></p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:75:"http://blog.wpde.org/2014/03/17/kommende-meetups-in-deiner-region.html/feed";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}}}s:27:"http://www.w3.org/2005/Atom";a:1:{s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:3:{s:4:"href";s:25:"http://blog.wpde.org/feed";s:3:"rel";s:4:"self";s:4:"type";s:19:"application/rss+xml";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:44:"http://purl.org/rss/1.0/modules/syndication/";a:2:{s:12:"updatePeriod";a:1:{i:0;a:5:{s:4:"data";s:6:"hourly";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:15:"updateFrequency";a:1:{i:0;a:5:{s:4:"data";s:1:"1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}}}}}}}}s:4:"type";i:128;s:7:"headers";a:9:{s:4:"date";s:29:"Tue, 20 May 2014 06:09:06 GMT";s:6:"server";s:6:"Apache";s:4:"vary";s:26:"Accept-Encoding,User-Agent";s:10:"x-pingback";s:31:"http://blog.wpde.org/xmlrpc.php";s:13:"last-modified";s:29:"Thu, 08 May 2014 19:39:14 GMT";s:16:"content-encoding";s:4:"gzip";s:14:"content-length";s:5:"15342";s:10:"connection";s:5:"close";s:12:"content-type";s:23:"text/xml; charset=UTF-8";}s:5:"build";s:14:"20140506164751";}', 'no');
